import React from 'react';
import style from './RoundButton.module.less';

export default function RoundButton({ children, className, ...props }) {
  return (
    <button
      className={
        className ? `${style.RoundButton} ${className}` : style.RoundButton
      }
      {...props}
    >
      {children}
    </button>
  );
}
